import React, { Component } from 'react';
import LineChart from '../LineChart/LineChart';
import SetTemperature from '../Utility/SetTemperature';
import Room from './Room';
import './rooms.css';

export default class Rooms extends Component {
  render() {
    return (
      <div>
        <div id='rooms'>
                <div className='room'>
                  <h1>Kitchen</h1>
                  <h5>Temperature: 26C</h5>
                  <h6>Status:cooling</h6>
                  {/* <button>Set Temperature</button> */}
                  <SetTemperature />
                  <LineChart 
                    width={600} 
                    height={400}
                    title={'Current Temperature'}
                  />
                </div>

                <Room roomName={"Kitchen"}/>

                <div className='room'>
                  <h1>Bedroom</h1>
                  <h5>Temperature: 26C</h5>
                  <h6>Status:cooling</h6>
                  <button>Set Temperature</button>
                  <LineChart 
                    width={600} 
                    height={400}
                    title={'Current Temperature'}
                  />
                </div>
                <div className='room' id='Livingroom'>
                  <h1>Livingroom</h1>
                  <h5>Temperature: 26C</h5>
                  <h6>Status:cooling</h6>
                  <button>Set Temperature</button>
                  <LineChart 
                    width={600} 
                    height={400}
                    title={'Current Temperature'}
                  />
                </div>
                <div className='room'>
                  <h1>Bathroom</h1>
                  <h5>Temperature: 26C</h5>
                  <h6>Status:cooling</h6>
                  <button>Set Temperature</button>
                  <LineChart 
                    width={600} 
                    height={400}
                    title={'Current Temperature'}
                  />
                </div>


        </div>
      </div>
    )
  }
}
